import React, { Fragment } from "react";
import './contact.css';

const ContactButton=(props)=>{
    const ScrollHandler=()=>{
        window.scroll({
            top:1850,
            left:0,
            behavior:'smooth'
        });
    }
    return(
        <Fragment>
            <button className="contact" onClick={ScrollHandler}>Contact_Me</button>
        </Fragment>
    );
};

export default ContactButton;
